import { useState } from 'react';
import { useEffect } from 'react';
import OpenAPIClientAxios from 'openapi-client-axios';
import React, { Component } from 'react'
import ClientInfo from "../components/ClientInfo.tsx";
import axios from 'axios';
import {ClientApiAxiosParamCreator, ClientApiFactory } from '../json/api.ts';
import { Configuration } from '../json/configuration.ts';
// import { apiClientGet as ClientApiAxiosParamCreator} from '../json/api.ts';



var f = ClientApiFactory(); 

function List() {
    
    const [data, setData] = useState([]);
    
    
    const optionsGet = {
        
        method: 'GET',
        headers: {
        'Content-Type': 'application/json',
        },
        
    };


    // f.apiClientGet(optionsGet)
    //     .then(response => {
    //         console.log(response);
    //     if (response.ok) {
    //         console.log("gfgfdgf");
    //         return  response.json();
    //     } else {
    //         throw response;
    //     }
    //     })
    //     .then(data => {
    //         console.log(data);
    //     })
    //     .catch(e => {
    //     console.log(e); 
    //     });
    
    useEffect(() => {
        (async () => {
            const {response} = await f.apiClientGet();
            const { data } = response;
            setData(data);
        })();
    }, []);
    const handleGetData = () => {


        const optionsGet = {
        
            method: 'GET',
            headers: {
            'Content-Type': 'application/json',
            },
            
        };
        
    
        // fetch('https://localhost:7205/api/Client', optionsGet)
        //     .then(response => response.json())
        //     .then(json => setData(json))
        //     .catch(error => {
        //     // Обработка ошибок
        //     console.error('Error:', error);
        // });
        // async function getData() {
        //     try {
        //         const response = await fetch('https://localhost:7205/api/Client', optionsGet);
        //         const json = await response.json();
        //         setData(json);
        //     } catch (error) {
        //         console.error('Error:', error);
        //     }
        // }
        // getData();
        
    }

    useEffect(() => {
        handleGetData();
    }, []);
    
    

    const handleDeleteData = (id) => {
        
        
        const optionsDelete = {
        
            method: 'DELETE',
            headers: {
            'Content-Type': 'application/json',
            },
            
        };
        console.log(id);
        fetch('https://localhost:7205/api/Client/' + id, optionsDelete)
            .then(response => {
                if (response.ok) {
                // Успешное удаление данных
                console.log('Данные успешно удалены');
                handleGetData();
                } else {
                // Обработка ошибки, если требуется
                console.log('Ошибка при удалении данных');
                }
            })
            .catch(error => {
                // Обработка ошибки, если требуется
                console.log('Ошибка при удалении данных:', error);
            });
    };
    

    return (
        <div>
            {data.map(post => 
                <div key = {post.id}>
                    <ClientInfo post = {post} handleDeleteData={handleDeleteData}/>          
                </div>
            )}
        </div>
    );
}


export default List
